import {Component, OnInit} from '@angular/core';
import {Company} from "./Models";

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent implements OnInit{
  title = 'hh-front';
  companies: Company[] = [];

  constructor(private companyService) {
  }

  ngOnInit(){
    this.companies.push(
      {id: 1, name: "Kolesa.kz", description: "lorem10", city: "Almaty", address: "Tole Bi 65"},
      {id: 2, name: "Kaspi.kz", description: "lorem11", city: "Astana", address: "Tauke Khan 23"},
      {id: 3, name: "Technodom", description: "lorem12", city: "Shymkent", address: "Abay 45"}
    )
  }
}
